      React.createElement(Route, { path: '/', element: React.createElement(HomePage) }),
      React.createElement(Route, { path: '/customers', element: React.createElement(CustomersPage) }),
      React.createElement(Route, { path: '/customers/new', element: React.createElement(CustomerFormPage) }),
      React.createElement(Route, { path: '/customers/edit/:id', element: React.createElement(CustomerFormPage) })
    )
  );
}

export default App;
